import { StyleSheet } from "@react-pdf/renderer"

import global from "./global"

export default StyleSheet.create({
  ...global,

  button: {
    backgroundColor: "#196e33",
    padding: 8,
    margin: "0 auto",
    color: "white",
    border: "3px solid #76ab86 ",
    borderRadius: "10%",
  },
})
